import { React,Component } from "react";
import styles from './Backdrop.module.css';

class BackDrop extends Component {
    constructor (props) {
        super(props);
        this.backDrop_ref = React.createRef();
    }

    render () {

        return (
            <div ref={ this.backDrop_ref } className={props.trigger ? styles.Backdrop : null} onClick={props.click}>

            </div>
        )

    }

}

export default BackDrop;
